import React from "react";

const SupportPage = () => {
  return (
    <div
      style={{
        backgroundColor: "black",
        color: "white",
        textAlign: "center",
        padding: "20px",
        fontFamily: "Arial, sans-serif"
      }}
    >
      <h1>Get Help and Support</h1>
      <p>Contact Information:</p>
      <p>Phone: 7505679809</p>
      <p>Email: xyz@vitstudent.ac.in</p>
      <p>Address: VIT chennai campus</p>

      <p>Operating Hours:</p>
      <p>Monday to Friday: 9 AM to 6 PM</p>
      <p>Saturday: 10 AM to 4 PM</p>
      <p>Sunday: Closed</p>

      <p>Services Offered:</p>
      <ul>
        <li>Maintainance Services</li>
        <li>Volunteer Opportunities</li>
      </ul>

      <p>Emergency Assistance:</p>
      <p>
        For urgent related issues or emergencies, please call our emergency
        helpline at [Emergency Contact Number].
      </p>
    </div>
  );
};

export default SupportPage;
